import Nav from "../components/Nav";

const Home = () => {
  const authToken = false;

  const handleCLick = () => {
    console.log("clicked");
  };

  return (
    <div>
      <Nav minimal={false} authToken={authToken} />
      <div className="home">
        <h1>Swipe Right</h1>
        <button className="primary-button" onClick={handleCLick}>
          {authToken ? "Signout" : "Create Account"}
        </button>
      </div>
    </div>
  );
};
export default Home;
